function Play(nick,audioFile,extWords){
  document.getElementById('nick').innerHTML=nick;
  document.getElementById('extWords').innerHTML=extWords;
  document.getElementById('audio').src=audioFile


 //用户信息部分样式设置
  $("#userHead").css("background", "rgba(0, 255, 255, 0.55)");//背景色：(红,绿,蓝,透明度)
  $("#userHead").css("box-shadow", "rgba(20, 20, 20 ,0.8) 1px 2px 5px");//投影：
  $("#userHead").css("border", "solid #efefef 4px");//边框颜色：
  $("#userHead").css("border-radius", "49px 0px");//边框圆角造型：
  $("#userHead").css("left", "40%");//用户初始x坐标标
  $("#userHead").css("top", "-70%");//用户初始y坐标标  
  $("#userHead").fadeIn();//0.1秒淡入
  $("#userHead").delay(10).animate({//0.01秒后运行动画
      left:'45%',//滑到左边坐标，可以是百分百或数字
	  top:'45%',//滑到上边坐标，可以是百分百或数字
      opacity:'1.0',//透明度，0到1
    });

//用户昵称部分样式设置
  $("#nick").css("background", "rgba(0, 255, 255, 0.0)");//背景色：(红,绿,蓝,透明度) 
  $("#nick").css("font-size", "22px");//字体大小
  $("#nick").css("text-shadow", "rgb(58 55 55) 0px 2px 2px");//投影：(红,绿,蓝,透明度) 


  //动图样式设置
  $("#gif").css("max-height", "144px");//动图最大高度，默认"144px"
  $("#gif").css("opacity", "0.0");//动图初始透明度，默认"0.0"
  $("#gif").css("left", "-40%");//动图初始x坐标，默认"-40%"
  $("#gif").css("top", "-200px");//动图初始y坐标，默认"-200px"
  $("#gif").delay(10).animate({//0.01秒后运行动画
      left:'46%',//滑到左边坐标，可以是百分百或数字
	  top:'150px',//滑到上边坐标，可以是百分百或数字
      opacity:'1.0',//透明度，0到1
    });

//欢迎感谢词语样式设置
   $("#extWords").css("left", "100%");//初始x坐标，默认"100%"
   $("#extWords").css("top", "37%");//初始y坐标，默认"37%"
   $("#extWords").css("max-width", "400px");//最大宽度，默认"400px"
   $("#extWords").css("max-height", "94px");//最大高度，默认"94px"
   $("#extWords").css("font-size", "22px");//字体大小,默认"22px"
   $("#extWords").css("color", "#ff0000");//字体颜色,默认"#ff0000"
   $("#extWords").css("background", "#0000ff00");//背景色,默认"#0000ff00"
   $("#extWords").delay(1000).animate({//1秒后运行动画
      left:'45%',//滑到左边坐标，可以是百分百或数字
	  top:'40%',//滑到上边坐标，可以是百分百或数字
      opacity:'1.0',//透明度，0到1
    });
  //$("body").delay(2000).fadeOut();//持续1秒后消失
//播放声音
   $("#audio").trigger("play");//如果不需要播放请在本行前加双斜杠//注释掉代码

}
